webpackJsonp([9985415514459],{3924:function(n,e){n.exports={data:{markdownRemark:{html:'<p>今回冬コミにての頒布物について大変残念なお知らせがあります。</p>\n<h2>TOUHOU UNREALの冬コミ頒布は中止します</h2>\n<p>こちらは正直な話、動作テスト版と称するにも余りに完成度が至らず、大変残念ですが今回冬コミでは頒布を見送らせていただきます。その代わりお詫びとしては何ですが、1月に動作テスト版を完全フリーでWeb公開致します。その後こまめにバージョンアップ・Web公開を重ね、「体験版」までフリーでWeb公開させて頂きたいと思います。</p>\n<h2>運命 -Wind of peace-の頒布遅延について</h2>\n<p>当サークルが委託にて扱うこととなった音楽CDですが、配送上のトラブルにつき、こちらは午後からの頒布となります。 話をまとめると当日の頒布物は</p>\n<ul>\n<li><strong>終日頒布：Leila Prismriver(音楽CD：300円)</strong></li>\n<li>\n<p><strong>午後より頒布：運命 -Wind of peace-(音楽CD/委託：800円)</strong>\nとなりますのでご了承ください。 遠方から遥々お求めになられる方には大変残念な結果となりますが、この場でお詫び申し上げたいと思います。どうかご理解の程宜しくお願い致します。</p>\n<h2>バナー誤字のお詫び</h2>\n<p><a href="/!/leila/">Leila Prismriver</a>のバナーに誤字がありました。11/30 C69とありますが正しくは<strong>12/30 C69</strong>です。(まぁホントに間違える人は居ないとは思いますが)修正しましたので差し替えると共にお詫び申し上げます。</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"2005-12-28T23:30:00+09:00",strDate:"2005/12/28",title:"冬コミC69の頒布物に関する告知"}}},pathContext:{path:"/ja/blog/2005/12/28-冬コミc69の頒布物に関する告知/",langKey:"ja"}}}});
